import React from 'react';
import PropTypes from 'prop-types';
import { Map, GoogleApiWrapper } from 'google-maps-react';

const Main = ({ carModel, hazardRating, path, google }) => {

    const mapStyles = {
        width: '40%',
        height: '50%'
    };

    return(
        <div className='grid-ver'>
            <div className='grid-hor'>
                <div>
                    <h1 className='text-primary' style={{ fontSize: '3.5rem', font: 'Candal', fontWeight: 'bolder' }}>Car Model</h1>
                    <body>{carModel}</body>
                </div>
                <div className=''>
                    <Map
                        google={google}
                        zoom={8}
                        style={mapStyles}
                        initialCenter={{ lat: 47.444, lng: -122.176 }}
                    />
                </div>
            </div>
            <div className='grid-hor'>
                <div>
                    <h1 className='text-primary' style={{ fontSize: '3.5rem', font: 'Candal', fontWeight: 'bolder' }}>Hazard Rating</h1>
                    <body>{hazardRating}</body>
                </div>
                <div>
                    <h1 className='text-primary' style={{ fontSize: '3.5rem', font: 'Candal', fontWeight: 'bolder' }}>Shortest Path</h1>
                    <body>{path}</body>
                </div>
            </div>
        </div>
    );
}

Main.propTypes = {
    carModel: PropTypes.string.isRequired,
    hazardRating: PropTypes.number,
    path: PropTypes.string
};

Main.defaultProps = {
    carModel: 'Volkswagen Beetle',
    hazardRating: 0,
    path: ''
};


export default GoogleApiWrapper({
    apiKey: 'AIzaSyCdN-PaaKG8Bh5xOhQLpWmAuGNX_0e3b2g'
})(Main);
